function addImageLink(defs, keys) {
    keys.forEach((key) => {
        let size = 8;
        if (key.indexOf("X64") !== -1) {
            size = 64;
        }
        defs.append("svg:pattern")
            .attr("id", key)
            .attr("width", size)
            .attr("height", size)
            .attr("patternUnits", "userSpaceOnUse")
            .append("svg:image")
            .attr("xlink:href", textures[key])
            .attr("width", size)
            .attr("height", size)
            .attr("x", 0)
            .attr("y", 0);
    });
}

function StreamGraph({ shield, action }) {
    const nodeRef = useRef();
    const digRef = useRef();
    const [currentLeft, setCurrentLeft] = useState(0);
    useEffect(() => {
        const margin = { top: 20, bottom: 20, left: 20, right: 20 };
        const width = window.innerWidth * 8.0 - margin.left - margin.right;
        const height = window.innerHeight * 0.5 - margin.top - margin.bottom;
        const dataSet = DataSet;

        const svg = d3
            .select(nodeRef.current)
            .append("svg")
            .attr("width", width)
            .attr("height", height)
            .append("g")
            .attr("transform", "translate(" + 40 + "," + margin.top + ")");

        const xScale = d3
            .scaleLinear()
            .domain(d3.extent(dataSet, (d) => d.xy[0]))
            .range([0, width]);
        // xAxies
        svg.append("g")
            .attr("transform", "translate(300," + height + ")")
            .call(d3.axisTop(xScale));

        const defs = svg.append("svg:defs");
        addImageLink(defs, Object.keys(textures));
        // yAxies
        const yScale = d3.scaleLinear().domain([0, 65]).range([0, height]);

        svg.append("g").call(d3.axisLeft(yScale));

        const colorScale = d3
            .scaleOrdinal()
            .domain(["c1", "c2", "c3", "c4", "c5", "c6", "c7", "c8", "c9", "c10"])
            .range([
                "url(#sttuX64)",
                "url(#fzntX64)",
                "url(#cushaX64)",
                "url(#lznxtX64)",
                "url(#quanfhhgyX64)",
                "url(#tzqfhhgyX64)",
                "url(#kzqfhhgyX64)",
                "url(#zdfhhgyX64)",
                "url(#quanfhhgyX64)",
                "url(#kzqfhhgyX64)",
            ]);

        const stackedData = d3
            .stack()
            .offset(d3.stacOrderReverse)
            .keys(["c1", "c2", "c3", "c4", "c5", "c6", "c7", "c8", "c9", "c10"])(dataSet);
        const areaGen = d3
            .area()
            .curve(d3.curveMonotoneX)
            .x((d) => xScale(d.data.xy[0]))
            .y0((d) => yScale(d[0]))
            .y1((d) => yScale(d[1]));
        svg.selectAll(".areas")
            .data(stackedData)
            .join("path")
            .attr("d", areaGen)
            .attr("fill", (d) => {
                return colorScale(d.key);
            });

        return () => {};
    }, []);
    useEffect(() => {
        const scroll = (evt) => {
            if (shield) {
                if (evt.target.scrollLeft <= 1000) {
                    digRef.current.style.left = evt.target.scrollLeft + "px";
                    setCurrentLeft(parseFloat(digRef.current.style.left));
                } else {
                    digRef.current.style.left =
                        parseFloat(digRef.current.style.left) -
                        (evt.target.scrollLeft - 1000) +
                        "px";
                }
                if (action.current) {
                    action.current.unshift({
                        act: "MOVE-CAM",
                        delta: `${nodeRef.current.scrollLeft}`,
                    });
                }
            }
        };
        nodeRef.current.addEventListener("scroll", scroll);
        return () => {
            if (shield) {
                nodeRef.current.removeEventListener("scroll", scroll);
            }
        };
    }, [shield]);

    return (
        <div style={{ position: "relative", display: "flex", alignItems: "center" }}>
            {shield && (
                <div
                    style={{
                        color: "#fff",
                        position: "absolute",
                        top: "0px",
                        left: "20px",
                    }}
                >
                    盾构里程: {currentLeft} M
                </div>
            )}
            <div
                style={{
                    position: "absolute",
                    top: "100px",
                    left: "0",
                    display: currentLeft > 40 ? "block" : "none",
                }}
                ref={digRef}
            >
                <img
                    src={"images/dig-bg.jpg"}
                    style={{
                        height: "56px",
                        width: "1000px",
                        position: "absolute",
                        left: "-1000px",
                    }}
                />
                <img src={dig} style={{ height: "56px" }} />
                <div
                    style={{
                        position:'absolute',
                        top:'-135px',
                        left:'300px'
                    }}
                >
                    <img src={
                        'images/gm.png'
                    } />
                </div>
                <div
                    style={{
                        position:'absolute',
                        top:'-135px',
                        left:'3500px'
                    }}
                >
                    <img src={
                        'images/gm.png'
                    } />
                </div>
                <div
                    style={{
                        position:'absolute',
                        top:'-135px',
                        left:'5500px'
                    }}
                >
                    <img src={
                        'images/gm.png'
                    } />
                </div>
            </div>
            <div
                style={{
                    height: `${window.innerHeight * 0.5 - 60}px`,
                    overflowY: "auto",
                    marginTop: "10px",
                    width: "40%",
                    backgroundColor: "#2ac9cf",
                    display: "flex",
                    flexDirection: "column",
                    alignItems: "center",
                    fontSize: "10px",
                    gap:'5px',
                    zIndex:10
                }}
            >
                <div
                    style={{
                        marginTop: "5px",
                        width: "64px",
                        display: "flex",
                        flexDirection: "column",
                        alignItems: "center",
                        color: "#fff",
                    }}
                >
                    <img src={textures["cushaX64"]} width={24} height={24} />
                    <span>粗砂</span>
                </div>
                <div
                    style={{
                        width: "64px",
                        display: "flex",
                        flexDirection: "column",
                        alignItems: "center",
                        color: "#fff",
                    }}
                >
                    <img src={textures["fzntX64"]} width={24} height={24} />
                    <span>粉质黏土</span>
                </div>
                <div
                    style={{
                        width: "64px",
                        display: "flex",
                        flexDirection: "column",
                        alignItems: "center",
                        color: "#fff",
                    }}
                >
                    <img src={textures["fxsha"]} width={24} height={24} />
                    <span>粉细砂</span>
                </div>
                <div
                    style={{
                        width: "64px",
                        display: "flex",
                        flexDirection: "column",
                        alignItems: "center",
                        color: "#fff",
                    }}
                >
                    <img src={textures["lznxtX64"]} width={24} height={24} />
                    <span>砾质黏性土</span>
                </div>
                <div
                    style={{
                        width: "64px",
                        display: "flex",
                        flexDirection: "column",
                        alignItems: "center",
                        color: "#fff",
                    }}
                >
                    <img src={textures["quanfhhgyX64"]} width={24} height={24} />
                    <span>全风化</span>
                    <span>花岗岩</span>
                </div>
                <div
                    style={{
                        width: "64px",
                        display: "flex",
                        flexDirection: "column",
                        alignItems: "center",
                        color: "#fff",
                    }}
                >
                    <img src={textures["tzqfhhgyX64"]} width={24} height={24} />
                    <span>土状强风化</span>
                    <span>花岗岩</span>
                </div>
                <div
                    style={{
                        marginTop: "5px",
                        width: "64px",
                        height: "64px",
                        display: "flex",
                        flexDirection: "column",
                        alignItems: "center",
                        color: "#fff",
                    }}
                >
                    <img src={textures["kzqfhhgyX64"]} width={24} height={24} />
                    <span>块状强风化</span>
                    <span>花岗岩</span>
                </div>
                <div
                    style={{
                        marginTop: "5px",
                        width: "64px",
                        height: "64px",
                        display: "flex",
                        flexDirection: "column",
                        alignItems: "center",
                        color: "#fff",
                    }}
                >
                    <img src={textures["zdfhhgyX64"]} width={24} height={24} />
                    <span>中等风化</span>
                    <span>花岗岩</span>
                </div>
            </div>
            <div
                style={{
                    overflowX: "auto",
                    scrollBehavior: "smooth",
                    scrollbarColor: "black",
                }}
                ref={nodeRef}
            ></div>
        </div>
    );
}

export default StreamGraph;
